async function sessionCompletion(o){try{var e=await fetch("/api/data/session-completion",{method:"POST",headers:{"Content-Type":"application/json"},body:JSON.stringify({userTimeZone:o})});if(!e.ok)throw await e.text(),420===e.status&&(alert("Your session has expired. Please log in again."),window.location.href="/login"),new Error("Network response was not ok");await e.json()}catch(o){}}export{sessionCompletion};